import React, { useState, useEffect } from 'react';
import { getRoles, getRol, createRol } from '../../api/apiClient';

export default function RolList() {
  const [items, setItems] = useState([]);
  const [id, setId] = useState('');
  const [one, setOne] = useState(null);
  const [newName, setNewName] = useState('');

  useEffect(() => { load(); }, []);
  function load() { getRoles().then(setItems).catch(e => alert('Error: ' + e)); }
  function fetchOne() { if (!id) return alert('Pon un id'); getRol(id).then(setOne).catch(e => alert('Error: ' + e)); }
  function doCreate() { if (!newName) return alert('Pon un nombre'); createRol(newName).then(()=>{ setNewName(''); load(); }).catch(e=>alert('Error: '+e)); }

  return (
    <div>
      <h3>Roles</h3>
      <div className="card">
        <button onClick={load}>Refrescar</button>
        <div style={{marginTop:8}}>
          <input placeholder="id" value={id} onChange={e=>setId(e.target.value)} />
          <button onClick={fetchOne}>Cargar por id</button>
        </div>
        <div style={{marginTop:8}}>
          <input placeholder="nuevo rol" value={newName} onChange={e=>setNewName(e.target.value)} />
          <button onClick={doCreate}>Crear rol</button>
        </div>
      </div>

      <div className="card">
        <strong>Lista (JSON)</strong>
        <pre>{JSON.stringify(items, null, 2)}</pre>
      </div>

      {one && <div className="card"><strong>Elemento</strong><pre>{JSON.stringify(one, null, 2)}</pre></div>}
    </div>
  );
}
